import React from 'react';

import "../styles/Buttons.scss";

export default function Buttons() {
  return (
    <div className='buttons-wrapper'>
      <button className='button'>
        <img className='button-image' src={require("../assets/buttons/undo.png")}/>
      </button>
      <button className='button'>
        Delete
      </button>
      <button className='button'>
        Add
      </button>
    </div>
  )
}
